export const projectsData = [
  {
    id: 1,
    title: "Simply Organize",
    description: "A web application to organize uploaded files, into a predefined folder structure on the server, improving pipeline execution efficiency by 30%. Built on HTML, JavaScript, Node.js, SQLite for the database and OAuth2 for authentication.",
    technologies: ["HTML", "JavaScript", "Node.js", "SQLite", "OAuth2"],
    image: "/images/simply-organize.png",
    features: [
      "Automated file organization system",
      "Secure authentication with OAuth2",
      "SQLite database for efficient data management",
      "30% improvement in pipeline execution efficiency",
      "User-friendly interface for file uploads"
    ],
    links: {
      github: "https://github.com/yourusername/simply-organize",
      live: "https://simply-organize.yourdomain.com"
    }
  },
  {
    title: "Genomic Data Processing Pipeline",
    description: "A high-performance pipeline for processing and analyzing genomic data, featuring parallel processing capabilities and advanced visualization tools.",
    technologies: ["Python", "Pandas", "NumPy", "Matplotlib", "Parallel Processing"],
    image: "/images/genomic-pipeline.png",
    github: "https://github.com/yourusername/genomic-pipeline"
  },
  {
    title: "Stock Market Analytics Dashboard",
    description: "Real-time stock market analytics dashboard with interactive charts, technical indicators, and predictive modeling capabilities.",
    technologies: ["React", "Node.js", "D3.js", "WebSocket", "Machine Learning"],
    image: "/images/stock-analytics.png",
    github: "https://github.com/yourusername/stock-analytics"
  },
  {
    title: "API Documentation Portal",
    description: "A comprehensive API documentation portal with interactive endpoints testing, code samples, and version control integration.",
    technologies: ["Angular", "TypeScript", "Swagger", "MongoDB", "Express.js"],
    image: "/images/api-docs.png",
    github: "https://github.com/yourusername/api-docs-portal"
  }
];
